import logo from './logo.svg';
import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Profile from './pages/'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path={"/profile"} element={<Profile/>}></Route>

      </Routes>
    </BrowserRouter>
  );
}

export default App;
